var title_f0_11_188="Inadequate treatment of maternal syphilis";
var content_f0_11_188=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F73418&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F73418&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Inadequate or suboptimal treatment of maternal syphilis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Inadequate therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Treatment with a nonpenicillin antibiotic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Treatment less than four weeks before delivery (including treatment with penicillin)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inappropriate dose for stage of disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Inadequate documentation of maternal treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lack of performance of serial non-treponemal* antibody titers after maternal treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Maternal therapy was not documented",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Inadequate response to therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Maternal non-treponemal antibody titers did not decline at least fourfold (two dilutions) after treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Maternal non-treponemal antibody titers suggest reinfection or relapse (ie, fourfold increase)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Non-treponemal test: Rapid plasma reagin (RPR) test or Venereal Disease Research Laboratory (VDRL) test.",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Centers for Disease Control and Prevention. Congenital syphilis (Treponema pallidum) case definition.",
"        <a href=\"file://www.cdc.gov/ncphi/od/ai/casedef/syphilisccurrent.htm\" target=\"_blank\">",
"         file://www.cdc.gov/ncphi/od/ai/casedef/syphilisccurrent.htm",
"        </a>",
"        . (Accessed on September 30, 2010).",
"       </li>",
"       <li>",
"        American Academy of Pediatrics. Syphilis. In: Red Book: 2012 Report of the Committee on Infectious Diseases, Pickering LK. (Ed), American Academy of Pediatrics, Elk Grove Village, IL 2012. Vol 29th, p.690.",
"       </li>",
"       <li>",
"        Risser WL, Hwang LY. Problems in the current case definitions of congenital syphilis. J Pediatr 1996; 129:499.",
"       </li>",
"       <li>",
"        Centers for Disease Control and Prevention, Workowski KA, Berman S, et al. Sexually transmitted diseases treatment guidelines, 2010. MMWR Recomm Rep 2010; 59:1.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
