" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 493px\">",
"   <div class=\"ttl\">",
"    Peptide hormone binding",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 473px; height: 265px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A peptide hormone in the extracellular space binds to a cell surface specific receptor causing stimulation of the cell. As an example, the signal produced by gastrin, a peptide hormone, would be transduced to the inside of the cell by binding to specific gastrin receptors on the cell surface.",
"    <div class=\"footnotes\">",
"    </div>",
